・大きなポケットがカジュアルな印象のレインコートです。<br>・バックスタイルはタック入りで広がり過ぎない綺麗なシルエット。<br><br>【ビコーズとは……】<br>KEEP CALM AND LOVE RAINY DAYS<br>好きなものは好き どんなトレンドの変化があっても、自分のスタイルがあるのが女の子。<br>冷たい雨の日や、風に舞う粉雪の日も、憂鬱な日や、大好きな人に会える日にも・・・<br>ビコーズのレインアイテムは、強く逞しく美しい現代の女性たちにしっかり寄り添って、今日も素敵な一日を演出します。<br><br><br>【商品スペック】<br>[サイズ]: 着丈/約80cm, 裄丈/約79cm, 胸囲/約96cm<br>[重量]: 約250g<br>[収納時サイズ]: 高さ/約21cm, 幅/約26cm, 奥行/約4cm<br><br>[企画国]: 日本<br>[生産国]: ミャンマー<br>[素材]: ポリエステル100％<br><br>【販売上の注意】<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
</center>

