・6つの機能がついたサイクルコートで雨の日の自転車が快適になる自転車用のレインコートです。<br>【サニーフィールズとは……】<br>「雨の日でもハッピーな気持ち」をコンセプトに、バラエティ豊かなアイテム展開が特徴のレインブランド。<br><br>【商品スペック】<br>[サイズ]: 着丈前/約95cm, 着丈後ろ/約90cm<br>[重量]: 約200g<br>[企画国]: 日本<br>[素材]: ポリエステル100%(裏面PUコーティング), 透明窓/塩化ビニル樹脂<br>[詳細]: <br>　視界を良好に保つ透明フード。<br>　風を逃す通気口。<br>　バタつきを軽減する内側ベルト。<br>　前カゴをすっぽり覆って固定する裾クリップ。<br>　着脱に便利な手出し口。<br>　夜間走行も安心な反射テープ付き。<br>【販売上の注意】<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
