急な雨にもさっと取り出せ、さっとかぶれるポータブルタイプのレインポンチョです。<br>傘と同じはっ水・防水加工が施された素材を使用していますので、強い雨でも安心です。<br>[サイズ]: 着丈/約97cm<br>[素材]: ポリエステル100%<br>[企画国]: 日本<br>[生産国]: 中国<br>[性別]: レディース<br>【plus nico(プラスニコ)とは……】<br>私たちが作る商品の多くは、雨傘だったり日傘だったりレインコートだったりイヤーマフだったり・・・誰もが普通に必要として手にする当たり前の商品ばかり。<br>長年蓄積してきた知識と技術をベースにしたモノづくりに取り組む一方で、既成概念や伝統に甘んじることなく、<br>常に時代のトレンドをとらえたクリエイティブな感覚を大切に新しい商品をお客さま一人一人にお届けしたいと思っています。<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
