雨の日にもオシャレをしたい・・・そんなときはdankeのレインケープがオススメです<br>魅力的なテキスタイルの中から貴方のお気に入りの1枚を選んでいただけます。<br>レインケープとしてだけではなく、広げればレジャーシートとしてもお使い頂けるので、雨の日に限らず使用シーンが広がります。<br>日常にちょっとした喜びを。日常のありふれた何気ない物や事柄に少しだけデザインをプラスすることで、 新たな気持ちで物と関われる。"Danke"は、そんなちょっとした物を提案しています。<br>使用時高さ(cm)89使用時幅(cm)142使用時奥行(cm)1<br>質量(kg)0.27<br>収納時高さ(cm)26.5収納時幅(cm)20.5<br>[生産国]: 中国<br>素材ポリエステル100％(はっ水加工)<br>[レインケープサイズ]: 着丈/89cm, 袖丈/72cm<br>[レジャーシート時サイズ]: 縦/178cm, 横/143cm<br>[付属品]: 収納ポーチ<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
